import React from 'react';
import logo from './logo.svg';
import './App.css';
import values from './values.json';
import KeyValue from './ViewObject';

function App() {
    const keys = Object.keys(values);
    return (
        <div>
            {keys.map(valuesKey => {
                return <KeyValue valuesKey={valuesKey} value={values[valuesKey]} />
            })}
        </div>
    )
}

export default App;
